import React from 'react';

const About1 = () => (
  <div style={{ width: '80%', height: 500, border: '1px solid black' }}>
    <div style={{ fontSize: '19px', fontWeight: 500, marginTop: 10 }}>
      Tech Stack!!
    </div>
  </div>
);

export default About1;
